import AboutMe from './About-Me';
import Portfolio from './Project';


const navigation = ({ section }) => {
	return (
		<>
			{section.includes('About Me') && <AboutMe />}
			{section.includes('Project') && <Project />}
		</>
	);
};

export default navigation;
